import "./Board.css"

export default function (props) { 

    const handleOnClick = () => {
        if(props.word.includes(props.char) && !props.correctGuesses.includes(props.char)){
            const guesses = [...props.correctGuesses, props.char]
            props.setCorrectGuesses(guesses)
            console.log(props.correctGuesses)
        }
    }

    return (
        <div key={props.char} className="key" onClick={handleOnClick}>{props.char}</div>
    )
}
